import { Link, useNavigate } from "react-router-dom";
import SignupTitle from "./signuptitle";
import React, { Component, useState } from "react";
import { registerAc } from "./store/actionCreaters";

const logoStyle = {
    position: 'absolute',
    width: '397px',
    height: '131px',
    left: '122px',
    top: '83px'
}

function SignupForm() {

    const [username, setusername] = useState('');
    const [email, setemail] = useState('');
    const [password, setpassword] = useState('');
    const [identity, setidentity] = useState('');

    const handleSubmit = async e => {
        e.preventDefault();
        // 后端
        function Test(props) {
            const data = props.registerFn.registerAc(username)
        }
        const data = await Test();

        console.log(data);
        let navigate = useNavigate;

        navigate("/", { replace: true });

        /* this.props.history.push("/"); */
    };
    const handleChange = e => {
        setusername(e.target.value);
    };
    const handleEmail = e => {
        setemail(e.target.value)
    };
    const handlePassword = e => {
        setpassword(e.target.value)
    };
    const handleIdentity = e => {
        setidentity(e.target.value)
    };

    return (
        <div id="signup-page">
            <Link to="/"><img src="./LOGO-H 1.png" alt='logo' style={logoStyle}></img></Link>
            <div>
                <form id="signup-form" onSubmit={handleSubmit}>
                    <SignupTitle />
                    <div>
                        <label className="user-info">
                            <input type="email" name="email" placeholder="Your email..." className="email" defaultValue={email} onChange={handleChange} />
                            <p></p>
                        </label>

                    </div>
                    <div>
                        <label className="user-info">
                            <input type="text" name="username" placeholder="Your username..." className="username" id="username" defaultValue={username} onChange={handleEmail} required />
                        </label>
                    </div>
                    <div>
                        <label className="user-info">
                            <input type="password" name="password" placeholder="Your password..." className="password" defaultValue={password} onChange={handlePassword} />
                        </label>
                    </div>
                    <div>
                        <label className="user-info">
                            <input type="password" name="confirmpassword" placeholder="Confirm password..." className="password" />
                        </label>
                    </div>
                    <div id="sign-radio">
                        <label>
                            <input type="radio" value="Normal" name="identity" class="identity" defaultValue={identity} onChange={handleIdentity} />Normal
                        </label>
                        <label>
                            <input type="radio" value="Professional" name="identity" class="identity" defaultValue={identity} onChange={handleIdentity} />Professional
                        </label>

                    </div>
                    <div id="sign-btn">
                        <input type="submit" value="Create Account" id="createAccount" />
                    </div>


                </form>
            </div>

        </div>
    )

};

